	var quesAll = [];
	function init(){
		var dictMap = new Map();
		for(var i=0;i<ques1.length;i++){
			dictMap.set(ques1[i].id,ques1[i]);
		}
		for(var i=0;i<ques2.length;i++){
			if(dictMap.has(ques2[i].id)){
				// console.log(JSON.stringify(ques2[i]),JSON.stringify(dictMap.get(ques2[i].id)));
			}else{
				dictMap.set(ques2[i].id,ques2[i]);
			}
		}
		console.log("总题目数：" + dictMap.size)
		for(let item of dictMap.values()){
			quesAll.push(item);
		}
	}
    function sreach(){
        // let quesType = document.getElementById('quesType').value;
        let keyWord = document.getElementById('keyWord').value;
        let queryArray = keyWord.split(' ').filter(item=>item);
		console.log("keyWord:",keyWord)
		let queryString = "";
		for(let key of queryArray){
			queryString+=key+'|';
		}
		queryString = queryString.substring(0,queryString.length -1);
		queryString = eval('/'+queryString+'/')
		let result = [];
		console.log("searchKey:",queryString)
        for(let item of quesAll){
			if(item.questionContent.search(queryString)!=-1){
				item.choiceItems;
				item.questionType;
				result.push(item);
			}
		}
		console.log("searchEnd")
		draw(result)
    }
	function draw(resultList){
		console.log(resultList);
		var resultDiv = document.getElementById("result");
		var resultHtml = "";
		for(let item of resultList){
			var divItem = "<div>";
			var divContent = "<p>"+item.questionContent+"</p><br>"
			var divChoice = "<ul>";
			if(item.choiceItems){
				for(let itemCho of item.choiceItems){
					divChoice+="<li "+(itemCho.isAnswer==1?"style='background-color : green'":'') +">"+itemCho.itemCode+". "+itemCho.itemContent+"</li>"
				}
			}
			if(item.judgeItems){
				for(let itemCho of item.judgeItems){
					divChoice+="<li "+(itemCho.isAnswer==1?"style='background-color : green'":'') +">"+itemCho.itemCode+". "+itemCho.itemContent+"</li>"
				}
			}
			
			divChoice +="</ul>"
			divItem+=divContent+divChoice+"</div>"
			resultHtml+=divItem;
		}
		resultDiv.innerHTML = resultHtml;
	}
